var rnd = bufio.NewReaderSize(rand.Reader, 1<<10)

func generateParallelNoBranch(dst, password, salt []byte, iteration, keyLen int, h func() hash.Hash, nThreads int) []byte {
	hLen := h().Size()

	if nThreads <= 0 {
		nThreads = runtime.NumCPU()
	}

	iters := (keyLen + hLen - 1) / hLen
	if iters < nThreads {
		nThreads = iters
	}

	return generateParallel(dst, password, salt, iteration, keyLen, h, nThreads, hLen, iters)
}

func TestGenerate(t *testing.T) {
	var dst []byte
	for _, tc := range testcases {
		dst = Generate(
			dst[:0],
			[]byte(tc.password),
			internal.HB(tc.salt),
			tc.iter,
			tc.klen/8,
			tc.hash,
		)

		expect := internal.HB(tc.mk)
		if !bytes.Equal(dst, expect) {
			t.Errorf("test failed\nexpect: %x\n   got: %x", expect, dst)
		}
	}
}

func TestGenerateParallel(t *testing.T) {
	var dst []byte
	for _, tc := range testcases {
		dst = generateParallelNoBranch(
			dst[:0],
			[]byte(tc.password),
			internal.HB(tc.salt),
			tc.iter,
			tc.klen/8,
			tc.hash,
			0,
		)

		expect := internal.HB(tc.mk)
		if !bytes.Equal(dst, expect) {
			t.Errorf("test failed\nexpect: %x\n   got: %x", expect, dst)
		}
	}
}

func BenchmarkGenerate(b *testing.B) {
	bench := func(h func() hash.Hash, iteration, keyLen, passwordLen, saltLen int) func(b *testing.B) {
		return func(b *testing.B) {
			password := make([]byte, passwordLen)
			salt := make([]byte, saltLen)
			out := make([]byte, keyLen)

			rnd.Read(salt)
			rnd.Read(out)

			b.ResetTimer()
			b.ReportAllocs()
			for i := 0; i < b.N; i++ {
				copy(password, salt)
				copy(salt, out)
				out = Generate(out[:0], password, salt, iteration, keyLen, h)
			}
		}
	}

	// https://cheatsheetseries.owasp.org/cheatsheets/Password_Storage_Cheat_Sheet.html#pbkdf2
	b.Run("SHA1: ITER 1_300_000", bench(sha1.New, 1_300_000, 129, 128, 128))
	b.Run("SHA256: ITER 600_000", bench(sha256.New, 600_000, 129, 128, 128))
	b.Run("SHA512: ITER 210_000", bench(sha512.New, 210_000, 129, 128, 128))
}

func BenchmarkGeneratePrarallel(b *testing.B) {
	bench := func(h func() hash.Hash, iteration, keyLen, passwordLen, saltLen int) func(b *testing.B) {
		return func(b *testing.B) {
			password := make([]byte, passwordLen)
			salt := make([]byte, saltLen)
			out := make([]byte, keyLen)

			rnd.Read(salt)
			rnd.Read(out)

			b.ResetTimer()
			b.ReportAllocs()
			for i := 0; i < b.N; i++ {
				copy(password, salt)
				copy(salt, out)
				out = GenerateParallel(out[:0], password, salt, iteration, keyLen, h, 0)
			}
		}
	}

	// https://cheatsheetseries.owasp.org/cheatsheets/Password_Storage_Cheat_Sheet.html#pbkdf2
	b.Run("SHA1: ITER 1_300_000", bench(sha1.New, 1_300_000, 129, 128, 128))
	b.Run("SHA256: ITER 600_000", bench(sha256.New, 600_000, 129, 128, 128))
	b.Run("SHA512: ITER 210_000", bench(sha512.New, 210_000, 129, 128, 128))
}

